import React from 'react';
import css from './semiCircle.module.css';
import PieChart from 'react-minimal-pie-chart';


const semiCircle = () => {
    return (
        <>
            <PieChart
            data={[
                
                { title: 'Two', value: 6.42, color: '#cc00ff' },
                { title: 'One', value: 9.43, color: '#00ccff' }
            ]}
            lineWidth={20}
            animate
            startAngle={180}
            lengthAngle={180}
        />
        </>);
}

export default semiCircle;
